    $(function() {
        if (typeof localStorage !== 'undefined') {
            var strage_key = 'digital_list_BookmarkButtonPopup';
            var dt = new Date();
            var dt_limit = new Date('2030/12/31 23:59:59');
            if (dt.getTime() <= dt_limit.getTime()) {
                var st_val = getStrage(strage_key);
                if (typeof st_val == 'undefined' || st_val == '' || st_val == null) {
                    displayPopup();
                }
                dt.setTime(dt.getTime() + ((60 * 60 * 24 * 1000) * 30 * 3));
                var expire_date = dt.getFullYear()  + "/" + (dt.getMonth() + 1) + "/" + dt.getDate() + " " + dt.getHours() + ":" + dt.getMinutes() + ":" + dt.getSeconds();
                setStrage(strage_key, '1', expire_date);
            }
        }
    });
